export const ONALLCLEAR = 'ONALLCLEAR'
export const ONBACKSPACE = 'ONBACKSPACE'
export const ONCLEAR = 'ONCLEAR'
export const ONEQUAL = 'ONEQUAL'
export const BUTTONCLICKED = 'BUTTONCLICKED'



export const onAllClear = (aclr) =>{
    return {
     type: 'ONALLCLEAR',
     res: aclr   
    }
}

export const onBackSpace = (bck) =>{
    return {
     type: 'ONBACKSPACE',
     res: bck   
    }
}
export const onClear = (clr) =>{
    return {
     type: 'ONCLEAR',
     res: clr   
    }
}
export const onEqual = (eql) =>{
    return {
     type: 'ONEQUAL',
     res: eql   
    }
}
export const buttonClicked = (val) =>{
    return {
     type: 'BUTTONCLICKED',
     res: val   
    }
}
